	/// 2. Create this formula in column B, the result is a PascalCase name: =SUBSTITUTE(PROPER(A1); " ";"")
	/// 3. Create this formula in column C, the result is a cammelCase name (carefully with &amp; symbol): =LOWER(LEFT(B1; 1)) &amp; RIGHT(B1;LEN(B1)-1)
	/// 4. Create this formula in column D, the result is a fixed cammelCase name - no keywords (carefully with &amp; symbol): =IF(C1="lock"; "@" &amp; C1; C1)
	/// 5. Create this formula in column E, the result is a private field declaration - no keywords (carefully with &amp; symbol): ="private static BootstrapIcon " &amp; D1 &amp; ";"
	/// 6. Create this formula in column F, the result is a public property - no keywords (carefully with &amp; symbol): ="public static BootstrapIcon " &amp; B1 &amp; " => " &amp; D1 &amp; " ??= new BootstrapIcon(""" &amp; SUBSTITUTE(LOWER(A1); " "; "-") &amp; """);"
	/// 7. Copy formulas in columns B, C, D, E and F to all rows.
	/// 8. Mark content of the E
	/// 9. Copy content to the clipboard and paste it below (replace current private fields).
	/// 10. Mark content of the F
	/// 11. Copy content to the clipboard and paste it below (replace current public properties).
